import React from 'react';
import '../../CSS/Main.css';

const navbar =props => {
    return(
        <header className="Navbar">
            <nav>
                <div><a href='/'>Logo</a></div>
                <div>Soduko Online</div>
                <div>
                    <ul>
                        <li><a href="/">LeaderBoards</a></li>
                        <li><a href="/">Login</a></li>
                    </ul>
                </div>
            </nav>
        </header>
    )
};
export default navbar;
